import React from "react";
import "./style.css";
import { HashLink } from 'react-router-hash-link';

export default function NavBar() {
  return (
    <nav>
    <Router>
      <ul>
        <li>
        <HashLink to="#top">Link to Hash Fragment</HashLink>
        </li>
        <li>
          <a href="about">About</a>
        </li>
        <li>
          <a href="projects">Projects</a>
        </li>
      </ul>
      </Router>
    </nav>
  );
}
